import Navbar from "./Navbar";
import Home from "./Home";
import Login from "./Login";
import Signup from "./Signup";
import About from "../about/About";
import Newuser from "./Newuser";
import User from "./User";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  /*const title = "Helvetica Neue";
  const likes = 50;
  const person = { name: "karen", age: 19 };
  const link = "http://www.google.com";*/

  return (
    <Router>
      <Navbar />

      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/Login">
          <Login />
        </Route>
        <Route path="/Signup">
          <Signup />
        </Route>
        <Route path="/About">
          <About />
          </Route>

          <Route path="/Newuser">
          <Newuser />
          </Route>
          <Route path="/User">
          <User />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
